package learnjava;

public class Switchcase {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

			for(int a=10;a<50;a=a+10) 
			
			switch (a)
			{
			case 10:
				System.out.println("10");
				break;

			case 30:
			continue;
						
			
			case 40:
				System.out.println("40");
				break;
				
			default:
				System.out.println("default");
			
			}

		}
	}


